This definition is for [scanf](https://www.npmjs.com/package/scanf), very useful library has implemented C like _scanf_ and _sscanf_.

``` typescript
/// <reference path="scanf.d.ts" />
import scanf = require("scanf");

console.log("Insert your age: ");
let age: number = scanf("%d");
console.log("Your age is " + age);

console.log("Parse variables word from string: ");
let variables = scanf.sscanf("samchon samchon@samchon.org 27", "%s %s %d", "id", "email", "age");
console.log(variables["id"], variables["email"], variables["age"]);
```

For hammerjs, eventType is a number, not a string.  It is compared to the following constants:

```
INPUT_START:  number;
INPUT_MOVE:   number;
INPUT_END:    number;
INPUT_CANCEL: number;
```

